import React from 'react'
import './PostCard.css'

const PostCard = ({user}) => {
  return (
    <div className = 'post-card'>
      <img className = 'user-img' src = {user.image} alt = 'user'/>
      <input></input>
    </div>
  )
}

export default PostCard
